import React from "react";
import './header.css';


function Header() {
    return(
    <div className="conteudo">
        <div className="top">
        <h1 className="h1Logo">MKS</h1>
        <h3 className="h3Logo">Sistemas</h3>
        <input className="btn-carrinho" type="button" value="0" />
        </div>

        
        
    </div>

    )
}

export default Header;
